INSERT INTO `story` VALUES (1,'Hans och Greta lämnar deras hem för att hitta mat. Svält har tagit deras föräldrar och de vill inte möta samma öde. Vem är du?'),(2,'Du är Hans, äldre bror och beskyddare av din yngre syster Greta. Du bestämmer dig för att ta din pilbåge och koger och hitta en hjort. Går du till bäcken eller gläntan?'),(3,'Du är Greta, yngre syster till din bror Hans och den som tar hand om ert hem. Du bestämmer dig för att plocka svamp och bär i skogen. Går du till gläntan eller till grottan? '),(4,'Du går till gläntan men hittar igen hjort. Det finns dock en varg där, en väldigt arg varg. Vad gör du? '),(5,'Du bestämmer dig för att avfyra en pil mot vargen och men du missar. Den hoppar på dig och sliter dig i stycken.'),(6,'Slut.'),(7,'Du börjar fly från gläntan men vargen börjar springa efter dig. Du kan se att Greta plockar bär längre bort och ett träd som ser ut att ha starka grenar. Vad gör du?  '),(8,'Du springer mot trädet och greppar tag om en av dess grenar. Vargen försöker attackera dig men biter tag i ditt koger av misstag. Du försöker ta en pil från ditt koger för att hugga vargen med den men vargen drar dig nästan ner på marken. Vad gör du?'),(9,'Du skriker efter hjälp och din syster kommer springandes. Vargen hoppar på din rygg och tvingar ner dig på marken. Innan du kan få av den så har den bitit tag i din nacke och allt blir svart.'),(10,'Du sparkar vargen i nosen och den släpper ditt koger. Du börjar klättra upp i trädet men vargen biter tag i ditt ben och sårar dig allvarligt. Du sparkar den med ditt bra ben och drar dig upp till den högre grenarna. Din syster kommer springandes och vargen hoppar på henne. Vad gör du?'),(11,'Du lossar kogret från ditt bälte och klättrar snabbt upp i trädet. Din syster kommer springandes och vargen hoppar på henne. Vad gör du?'),(12,'Du skjuter en pil mot vargen och med din överblick frän trädet träffar du den i halsen. Vargen dör och faller av din syster och du kan se blod på Gretas kläder.'),(13,'Greta har bara lindriga skador från vargens attack och ni kan plåstra om henne relativt snabbt. Efter att Greta har tagit hand om ditt skadade ben så funderar ni på om ni ska lämna eller flå vargen. Vad gör du?'),(14,'Du tar Gretas kniv och börjar flå vargen. När du skär upp dess mage trillar en runa ut. Vad gör du med runan?'),(16,'Du tar runan och känner dig starkare. Innan Greta hinner reagera så har du sprungit iväg mot bäcken. Ditt ben blöder inte längre och du hittar en hjort. Du skjuter hjorten med ett välplacerat skott och den dör. Med hjortens kött så kan ni äta er mätta igen och varje dag som du går ut för att jaga så hittar du ett byte. Ni går aldrig hungriga igen.'),(17,'Du bestämmer dig för att lämna runan och ta vad du kan från vargen. Du tar dess päls som en mantel och dess kött så att du och din syster kan äta. Med hjälp av vargpälsen så blir du känd som en fantastiks jägare och byborna kallar på dig när de behöver jaga ett farligt djur. Du och din syster får rikligt betalt för varje djur du dödar och ni går aldrig hungriga igen. '),(18,'Du hoppar ner till marken och tar en pil från ditt koger. Du skjuter en pil mot vargen som gräver sig in i monstrets rygg och vargen springer iväg, ylandes i smärta.  '),(19,'Greta har allvarliga skador och du försöker plåstra om henne så gott du kan. Du inser snabbt att du inte hinner ta henne till byns hospis och du måste ha hjälp från någon snabbt. Du kommer tänka på häxan som bor i skogen och hennes magiska krafter. Du vet inte vad du måste göra för att hon ska hela din syster med du har inget annat val. '),(20,'Efter mycket letande efter sötsakerna som häxan markerar hennes stigar med så hittar du häxans stuga. Dens väggar är gjorda av pepparkakor och dess tak är gjort av hård karamell. Trapporna upp till häxans dörr är gjorda av socker och dörren är mjuk som marsipan. '),(21,'Dörren öppnar av sig själv och häxan stiger ut. Hon kollar på dig och din syster innan hon slickar sig om läpparna. \r\n\r\n\"Och vilka är ni? Har du kommit för att döda mig?,\" säger häxan och tar ett hårt tag om hennes trollstav.\r\n\r\nDu berättar om vargen och att Greta kommer dö utan häxans hjälp. Häxan ser fundersam ut innan hon släpper in dig i hennes stuga. \r\n\r\n\"Jag kan läka flickan, men då måste du betala mig,\" fnissar hon och rör runt i en gryta som ligger i mitten av rummet. \r\n\r\nNär du lovar att betala häxan vad hon än vill ha så skrattar hon. \r\n\r\n\"Jag vill ha ett barn från byn. Gärna en mör liten flicka som jag kan ha som piga innan jag äter upp henne,\" säger häxan och slickar sig om läpparna. \r\n\r\nGår du med på häxans villkor?'),(22,'Du lovar att hämta häxan ett barn och beger dig mot staden. Du möter många vedhuggare längs vägen men inga barn. När du närmar dig kyrkan ser du en flicka leka vid ett träd och prästen plantera blommor. Vad gör du?'),(23,'Du lurar flickan ut i skogen med löften av godis och du tar henne till häxans stuga. När du öppnar dörren till stugan så blir du nedslagen av häxan. Det sista du ser innan hon slår dig i huvudet är din syster klädd som en piga.'),(24,'Du går till prästen och berättar allt som har hänt. Han lovar dig att han ska rädda din syster och han samlar alla byborna för att storma häxans stuga. Alla människor i byn samlar på sig facklor och vapen innan de marscherar in i skogen. '),(25,'Du och resten av männen i byn tar er till häxans stuga. Hon öppnar sin dör och går ut till er, klädd i en gyllene skrud. Hon höll i hennes trollspö och riktade det mot de alla. \r\n\r\n\"Du kar kommit för att döda mig!\" fräste hon och skickade iväg en blixt från hennes trollspö mot prästen. \r\n\r\nPrästen höll upp hans bibel för att skydda sig men förbannelsen brann sig bara igenom boken. Prästen skrek medans han förvandlades till ett träd och resten av byborna sprang mot häxan. Vad gör du?'),(26,'Medans häxan är distraherad av byborna så springer du till stugans baksida. Du smiter in genom bakdörren och hittar din syster liggandes på golvet. Hon har blivit läkt av häxan men är inte vid medvetande. Du plockar upp Greta från marken och springer ut via bakvägen. Du ser hur byborna håller på att förlora striden mot häxan. Du har fortfarande din pilbåge och koger. Du kan försöka döda häxan innan hon vinner slaget eller fly med din syster. Vad gör du? '),(27,'Du lägger ner din syster på marken och skjuter en pil mot häxan. Pilen träffar henne i ryggen och hon skriker till i smärta. Häxan vänder sig mot dig och kastar en trollformel. Innan du hinner ducka blir du träffad av en blixt i magen och du faller till marken. Häxan skrattar innan en bybo sticker henne i ryggen med hans högaffel. Alla byborna hoppar på häxan och sticker henne med deras vapen medans hon bara kan skrika. När häxan är död så bryts trollformeln över prästen och han blir till en människa igen. Du kan se Greta öppna sina ögon innan det svartnar för dina.'),(28,'Efter din begravning så reser staden en staty i ditt namn. Den är gjord av glänsande stål och inskriptionen på statyn säger: \"Hans, hjälte, broder och jägare av häxor.\" \r\n\r\nGreta behöver aldrig gå hungrig igen efter du gav ditt liv för staden. Hon är givet ett hus nära kyrkan och får mat från byborna. När hon väl får barn så berättar hon om Hans häxjägaren, hennes bror som räddade staden och alla som bor i den. Ditt liv blir en legend som berättas om igen och igen och igen av människor i kungariket tills fakta blir fiktion.'),(29,'Du flyr med din syster från striden. Du lämnar byborna för att dö och du springer mot eran stuga. Efter många minuter springandes så anländer du vid er stuga, men häxan väntar på er. Hon är täckt med blood och hon ler ondskefullt. Hon kastar en besvärjelse mot dig och innan du hinner reagera så är Greta aska. Vad gör du? '),(30,'Du kastar dig mot häxan med ett skrik av ilska och hon kastar fler trollformler mot dig. Din arm blir till en gren, din högra fot blir till en sten och ditt hår blir guld. Du känner dina ben förvandlas till glass och hur ditt blood blir till grädde. Men trots allt detta lyckas du ta dig till häxan och du slår trollspöet ur hennes händer. Utan hennes vapen så är hon bara en äcklig gammal gumma och du slår henne i ansiktet. Alla ben i din högra hand och arm spricker från smällen och du skriker i smärta medans glas skär sig igenom ditt skin och kött. Innan häxan hinner ta trollstaven så trampar du på den med din stenfot och den går itu. Ljus exploderar från trollstaven och allting blir svart. '),(31,'Du faller till dina knän och stirrar på askan i dina händer. Innan du hinner säga någonting så börjar du förvandlas till såpbubblor. Innan ditt huvud försvinner hoppas du att Greta väntar på dig på andra sidan.'),(32,'När du vaknar upp så är din fot inte längre gjord av sten och ditt hår är inte längre gjort av guld. Ditt blod verkar inte längre vara grädde och dina ben är inte längre glas. Häxan är också borta, det är bara en svart sotfläck kvar där hon stod. Alla dina sår är läkta och du upptäcker massor av symboler på dina armar och ben. De liknar runor och de glöder rött som eld när du rör de. Du ser Gretas aska ligga på marken och går långsamt fram till vad som en gång var din syster. Du plockar upp aska från marken och det rinner genom dina fingrar. Du står där över askan i flera timmar innan du reser dig upp och går iväg till eran, nu din, stuga. '),(33,'Du lämnar din stuga men din pilbåge och en ryggsäck. Du låter dina fötter leda vägen medans du år in i skogen och du kollar inte tillbaka. Resten av byborna skulle bränna dig på bål om de såg symbolerna på dina lemmar och du har ändå ingenting kvar som binder dig till denna plats. Fåglarna kvittrar och djuren återvänder till skogen, men du ser inget av detta och bryr dig inte. Du fortsätter in i skogen och kollar inte tillbaka. '),(34,'Du skjuter en pil mot häxan och den förvandlas till fjärilar innan den kan nå henne. Häxan förvandlar dig till ett träd och du kan bara se på medans hon slaktar byborna. '),(35,'Du beger dig till grottan och längs vägen hittar du massor med svamp och bär. Du fyller din korg och när du väl kommer fram till grottan så har du nog med mat för att göra en stuvning. Du hoppas att Hans har hittat en hjort eller en kanin så ni har kött hemma igen. När du väl ska börja gå tillbaka hör du ett ljud från grottan. Vad gör du?'),(36,'Du går för att undersöka ljudet och du går in i grottan. Solen skiner in genom grottöppningen och du kan se symboler inristade på väggarna. Du rör en av symbolerna som liknar ett \'F\' och den glöder rött som om märket brann. Du drar snabbt undan din hand och du börjar lämna grottan innan du ser en lägereld längre in. En gammal man sitter vid lägerelden och han kollar på dig med ett uttryckslöst ansikte. Vad gör du?'),(37,'Du lämnar den gamla mannen och grottan och säger ingenting till Hans. Ni äter kanin och svamp stuvning den kvällen och du tänker aldrig på den gamla mannen igen. '),(38,'Du går fram till den gamla mannen och introducerar sig. Han bara blinkar och ger dig en kåsa fylld men kanin och svampstuvning. När du undrar om han har gjort den själv så skrattar han och skakar på huvudet. \r\n\r\n\"Maten fick jag från dig, eller snarare en annan dig,\" Säger han. \r\n\r\nDu undrar vad han menar med det och han skrattar igen. \r\n\r\n\"Allt det här har hänt förut. Dina val är inte dina val flicka lilla. Gudarna bortom vår verklighet styr varje ben i din kropp,\" säger han och äter från stuvningen. '),(39,'Du ifrågasätter vad han har sagt och mannen skrattar. Han pekar på symbolerna på väggarna, du inser nu att de är runor. \r\n\r\n\"Häxan, du och din bror är en del av en historia. En historia som gudarna berättar om och om igen för deras underhållning,\" säger han. \r\n\r\nDu säger att han ljuger och att han är galen. Du börjar lämna grottan men hör hans röst igen. \r\n\r\n\"Vad gjorde du igår?\" Frågar den gamla mannen med ett leende. \r\n\r\nDu håller på att svara honom när du inser att du inte vet vad du gjorde dagen innan. Du söker ditt minne men du kommer inte ihåg någonting. Du vet att ditt namn är Greta och att din brors namn är Hans, men vad hette era föräldrar? När dog era föräldrar? Det känns som du är ett blankt skal som bara vet grundläggande information om ditt eget liv. \r\n\r\n\"Du är bara en del av en historia flicka lilla. Alla val du ser framför dig är vägar gudarna har lagt,\" säger han. '),(40,'\"Nej jag lämnar inte grottan!\" skriker Greta. \r\n\r\nGreta börjar lämna grottan-\r\n\r\n\"Jag vägrar att lyssna på dig!\" säger hon och återvänder till den gamla mannen. \r\n\r\nDen gamla mannen skrattar och pekar på runorna ännu en gång. \"Här når inga gudar eller häxor! En som bär eller bor på dessa märken kan forma sitt eget öde!\"\r\n\r\nDu begär att du lyssnar på dig, att de håller sig till världens manus. Greta ignorerar dina ord och den gamla mannen fnissar. Utan någon kontroll över Greta så förlorar du grepp över skogen och alla som bor i den. Staden inser att de har låtit en häxa äta deras barn och de bränner ner hennes stuga. Häxan inser vad hon har gjort under order från hennes trollspö och hänger sig själv från en gren. Hans lyckas döda en hjort innan han inser att de har mat hemma och att deras föräldrar lämnade pengar åt de för att köpa ett hus i staden. \r\n\r\nDu skriker i frustration medans världens manus slits i stycken och alla dina historier och val raderas. Greta fortsätter att ignorera dig medans du förlorar kontroll över deras värld och efter ett starkt ljus så finner du dig i gudarnas datorrum. Du har misslyckats och deras värld är fri från dina historier och val.  '),(41,'Du går till bäcken och ser en hjort. Du siktar en pil mot djuret och skjuter mot dens nacke. Du ser hur pilen missar hjorten men några centimeter. Ditt byte börjar fly från bäcken in i skogen. Innan du springer efter hjorten så ser du en man som kommer springandes mot dig. Vad gör du?'),(42,'Du springer efter hjorten medans mannen argt säger åt dig att stanna. Du lyssnar inte på hans skrikande och fortsätter följa efter ditt byte. Den leder dig genom en del av skogen där träden är gråa och torra. Marken är täckt med döda löv och de blir till stoft när du rör dem. Hjorten flyr in bland ett par buskar och försvinner. '),(43,'Du springer in bland buskarna och försöker följa efter hjortens spår. Innan du hinner reagera så försvinner marken under dina fötter och du rullar ner för en kulle. Torra kvistar skär dina armar och ben medans din pilbåge går itu. Innan du når botten av kullen så slår du ditt huvud på en sten och det svartnar för dina ögon.  '),(44,'När du vaknar till är det mörk ute. Månens sken är det ända som låter dig att se och det enda vapnet du hade med dig är trasigt. Du försöker klättra upp för kullen men jorden är för mjuk och den ger vika för din vikt. Du bestämmer dig för att snabbt göra upp en lägereld och samlar på dig torra kvistar och bitar från döda träd. När du väl har hittat bränslet till din brasa så tänder du elden med hjälp av bågsträngen, en pinne och muskel kraft. Plötsligt hör du någon som skriker längre in i den döda skogen, det låter som en man. Vad gör du?'),(45,'Du lämnar din lägereld och följer mannens skrik. Tillslut så hittar du honom och du inser snabbt att det är samma man som jagade dig tidigare. Hans ben sitter fast i en klump av trä och hans kläder är blodiga. När han ser dig lyser hans ögon upp och han viftar hejvilt. \r\n\r\n\"Få mig härifrån innan hon kommer tillbaka!\" Skriker han. \r\n\r\nNär du undrar vem han menar så tystnar alla ljud i skogen. Det är som alla fåglar, insekter och djur dog på samma gång. Du ser hur löven börjar virvla runt en figur längre bort i skogen. \r\n\r\n\"Hon är här! Hjälp mig!\" Säger mannan och försöker dra lös hans ben från klumpen med rötter som har bildats runt den. \r\n\r\nVad gör du?'),(46,'Du försöker hjälpa mannen och drar i hans armar, men hans ben lossnar inte från rötterna. Du kan nu se att löven gömmer en kvinna bakom sig. Hennes svarta hår når till hennes knän och hennes gula ögon stirrar in i dig själ. Utan att du inser det så börjar du springa och varelsen följer efter dig. \r\n\r\n\"Fortsätt springa!\" Skriker mannen till dig medans kvinnan passerar honom utan att bry sig. '),(47,'Du flyr från kvinnan och ser hur rötterna och grenarna slingrar ihop sig framför dig. De bildar väggar bland träden och snart har du bara en stig att följa. Du kan se ett gammalt hus vid vägens slut och inser att det är din enda chans mot den konstiga kvinnan. Du tar dig fram till huset och lyckas kasta dig in till dess hall. Du sparkar igen dörren rakt i kvinnans ansikte och hon skriker av frustration. Du barrikaderar dörren med allt du kan hitta innan du andas ut. '),(48,'Du undersöker huset och försöker hitta ett vapen som du kan använda mot kvinnan. Du hittar en rostig eldgaffel och svingar den mot en gammal stol. Stolen rasar ihop från ditt slag och du försätter undersöka huset. Du hittar en gammal målning av en familj som troligen bodde i huset. Mannens ansikte har bränts bort medans dottern och mamman i målningen ser glada ut. Du hör plötsligt hur något bankar på dörren. ');
